def addtogroup(computer_id,GETTOKEN):
    """Send API PUT request for updating the Static 7R Exodus group"""

    url = "https://sevenrooms-jamf.electric.ai:8443/JSSResource/computergroups/id/43"
    payload = "<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<computer_group>\n    <computer_additions>\n        <computer>\n            <id>%s</id>\n        </computer>\n    </computer_additions>\n</computer_group>" % (computer_id)
    token = 'Basic %s' % (GETTOKEN)
    headers = {
    'Authorization': token,
    'Content-Type': 'text/plain'
    }

    response = requests.request("PUT", url, headers=headers, data=payload)

    print(response.text)

